import React from 'react';

const Wishlist = ({ wishlist }) => {
  return (
    <div className="wishlist-container">
      {wishlist.length === 0 ? (
        <p>Нет товаров в списке желаемого</p>
      ) : (
        wishlist.map(item => (
          <div key={item.id} className="wishlist-item">
            <h3>{item.name}</h3>
            <p>{item.price} ₽</p>
          </div>
        ))
      )}
    </div>
  );
};

export default Wishlist;
